import React, { useMemo } from 'react'

function Post(props) {
  const { post } = props;
  console.log(post.id)

  useMemo()

  return (
    <>
        <li key={post.id}>
            <h3>{post.title}</h3>
            <p>{post.body}</p>
        </li>
    </>
  )
}

export default Post
